INSERT INTO `curriculum` (`id`, `subject`, `files`, `semester`, `grade`, `period`, `topic`, `learning_outcome`, `objectives`, `contents`, `activities`, `materials`, `competency_assessment`) VALUES
(3, 'Social Studies', '', '1', 'Grade One', '1', 'SELF IDENTITY AND RESPONSIBITIES OF FAMILY MEMBERS', 'Learners are able to exhibit a sense of belongingness to a family. \r\nLearners are able to openly discuss gender issues \r\nDifferentiate among different types of relationships  \r\nRespect people with disabilities in the community', 'Upon completion of this topic, learners will: \r\n Identify family structure   Create awareness on gender issues Determine the role of each family member in the home Differentiate relationships in the family Support people that are disabled', 'Single-parent family Nuclear family \r\n Extended family \r\n Definition of gender \r\n Roles and responsibility of boys and men Roles and responsibility of women and girls \r\nAdvantages of equal educational opportunities  for girls and boys Family relationships   \r\nLove  \r\nFriendship \r\n \r\nCare  \r\nIssues affecting people with disabilities', 'Inclusive and Differentiated Learning Individual seat works or work in mixed groups according to gender, abilities, learning styles, etc., \r\n Individual work: Tell the names of family members in your home and discuss the family type you belong to Mixed Group work: Identify males and females in your family and write the role of each; (b) identity every member of your family by name  Individual work: Discuss the meaning of gender Mixed Group work:  List some responsibilities of (a) boys and men, and (b) girls and women Individual work: Discuss the place of the child in the family Home work: Identify educated women in your family and community and state what contrast you see between them and uneducated women Group work: Discuss the things family members do to show love to each other Individual work: How does a family care when a family member is sick? Role play good and bad touches. Explain how and where bad touches can be reported. Debate: When someone tries to touch you in a bad way, what will you do? (b) Who will you tell, and why? Pass the Pen Activity on best ways to treat people with disabilities Individual work: Discuss how to demonstrate care for the disabled Individual work: Draw a picture showing care for the sick and the disabled.', 'Cardboard cutout of family types: \r\n1. single-parent family 2.nuclear family 3. extended family', 'Expected COMPETENCIES \r\n1.Effective communication skills   2. Analytical and research skills 3. Research and problem solving skills   ASSESSMENT STRATEGIESS  \r\n Will be used to test for competencies, select relevant options. \r\na. Quizzes b. Class works c. Assignments, attendance d. Class participation e. Individual presentations,'),
(4, 'Social Studies', '', '1', 'Grade One', '2', 'LIVING TOGETHER AT HOME AND SCHOOL', 'Learners are able to explain the importance of  protecting the environment \r\nLearners are able to outline how farming, logging, mining, and other activities impact the forestland \r\nLearners are able to describe the influence of weather and climate on agriculture \r\nLearners are able to use the forestland wisely Learners are able to identify renewable energy sources Upon completion of this topic: students will be able to: \r\n1. Discuss the characteristics that make up a home  2. Develop respect for community leaders Follow health rules at home and at school \r\n3. Apply safety rules at home and at school 4. Give the direction of their home and school 5. Report bullying to school authorities or parents', 'Upon completion of this topic: students will be able to: \r\n1. Discuss the characteristics that make up a home  2. Develop respect for community leaders Follow health rules at home and at school \r\n3. Apply safety rules at home and at school 4. Give the direction of their home and school 5. Report bullying to school authorities or parents \r\nThe', 'The home  \r\n1. the family 2. rules and norms governing the home 3. rules and norms governing the community 4. Home and environment 5. Sanitation 6. Prevention of water-borne diseases 7. Safety rules  8. Safe use of electrical and electronic gadgets 9. Direction map of home and school 10. Google map 11. Friendly manners 12.  Unfriendly manners', 'Inclusive and Differentiated Learning \r\n \r\nIndividual seat works or work in mixed groups according to gender, abilities, learning styles, etc. \r\n \r\nIndividual work:  State how each of these persons help in the family: father, mother, brother, sister, grandparents, aunts, uncles  Individual work: On a poster sheet, sketch a picture of your family tending to your sibling while he/she was sick \r\nMixed Group work:  Name and discuss some leaders in your community \r\nIndividual work: Name some ways you can be a good leader in your community \r\nRole play a community leader visiting your school to discuss his/her role and responsibility as leader of the community \r\nMixed Group work: Organize a hand washing exercise with the class showing the correct way to hand wash  \r\nMixed Group work: Carry out cleanup campaign on campus and around home \r\nIndividual work: Recommend some important things you do to keep your community clean Home work: Discuss ways to prevent waterborne diseases from harming people \r\nMixed Group work: On large poster sheets, draw objects that are harmful to play with Mixed Group work: Demonstrate safe ways to cross the motor road  \r\n Mixed Group work: Demonstrate safe ways to use mobile phones and computers \r\nIndividual work :Draw the neighborhood  of your home and school, and color the roads leading to your home  \r\nIndividual Work: Explain how someone can be bullied in the school and the community', 'Visual aids  Markers Posters Readings: Posters showing group of people mediating a problem  Pictures of community leaders towel, tissue, hoes , wheelbarrows, brooms, rakes  Visual aid showing objects harmful for children to play with. \r\n Poster showing crosswalk Drawing of a home and school.  \r\nPosters of school activities (e.g: school playground, Visual aids  Markers Posters Readings: Posters showing group of people mediating a problem  Pictures of community leaders towel, tissue, hoes , wheelbarrows, brooms, rakes  Visual aid showing objects harmful for children to play with. \r\n Poster showing crosswalk Drawing of a home and school.  \r\nPosters of school activities (e.g: school playground,', 'EXPECTED COMPETENCIE S  \r\n1.Effective communicat ion skills   2.Analytical and research skills 3.Research and problem solving skills   ASSESSMENT STRATEGIES: \r\n  will be used to test for competencies, select relevant options. \r\na. Quizzes b. Class works c. Assignment s,'),
(5, 'Social Studies', '', '1', 'Grade One', '3', 'MAN AND HIS ENVIRONMENT', 'Learners are able to explain the importance of  protecting the environment \r\nLearners are able to outline how farming, logging, mining, and other activities impact the forestland \r\nLearners are able to describe the influence of weather and climate on agriculture \r\nLearners are able to use the forestland wisely Learners are able to identify renewable energy sources Learners are able to identify natural resources for revenue', 'Upon completion of this topic, learners will: \r\n1. Define the environment  2. Describe man�s specific activities carried on in the environment  3. Define weather and climate  4. Explain how farming and charcoal burning destroy the forestland 5. Distinguish natural resources for energy and those for generating revenue for the country', 'Definition of environment \r\n1. Where people live 2. Where animals live Plants \r\nRiver bodies \r\nMountains  \r\nHow people influence the environment \r\nEffect of weather on living things  Effect of climate change \r\n \r\nFarming methods that protect the forest  \r\n \r\nNatural Resources', 'Inclusive and Differentiated Learning Individual seat works or work in mixed groups according to gender, abilities, learning styles, etc. \r\n \r\nTeacher For The Day: \r\n Discuss with the class how people depend on the environment for survival Draw a map of your environment showing plants and animals  \r\nMixed Group work: Discuss slash-and-burn farming and its impact on the natural vegetation \r\n \r\nIndividual work Discuss how charcoal burning and charcoal use are negative to your health Individual work What is plastic pollution, and how can you help to solve the problems of plastic pollution Mixed Group work Discuss some new ways  we can protect the environment Individual work Discuss the two main seasons in Liberia and how they help or hinder farming activities  Mixed Group work Make diagrams and use them to explain the impact of climate change Mixed Group work Make a field trip to a slash-andburn farm, and report your observation to the class Individual work Discuss natural resources used for energy \r\nIndividual work List and discuss natural resources for renewable energy, and (b) revenue \r\n \r\nIndividual work Identify natural resources in each county', 'Pictures of forest, towns, mountains and rivers \r\nPhysical map \r\nPosters showing axes and cutlasses, power-saw Diagram of deforested land, desert, etc.  Pictures of garbage disposal sites Drawings  Pictures of deforested lands  Charcoal  A light bulb   Online sources: Alliant Energy Kids \r\n \r\nTrue Aim Education Map of natural resources in Liberia', 'EXPECTED COMPETENCIES  \r\n1. Effective communication skills   2. Analytical and research skills 3. Research and problem solving skills   ASSESSMENT STRATEGIES: \r\n  That will be used to test for competencies, select relevant \r\na. Quizzes b. Class works c. Assignments, attendance'),
(6, 'Social Studies', '', '1', 'Grade One', '4', 'BASIC NEEDS: SIMILARITIES IN LIBERIA AND OTHER WEST AFRICAN COUNTRIES', 'Learners are able to recognize that the basic needs of man are necessary for one�s survival \r\nLearners will demonstrate the proper use of communicatio n gadgets \r\nLearners will appreciate the benefits of transportation to the socio and economic development', 'Upon completion of this topic, learners will: \r\n1. Categorize the basic needs of man as food, clothing, shelter, healthcare, education 2. Analyze the importance of each of the needs 3. Discuss the means of communicati on and transportatio n', 'Basic needs of man Foods: Clothing , Shelter , Healthcare , Education  , Tools for communicatio n , Transportation  Foods \r\n, The importance of food to man , Sources of food , Nutrition  , Food types and category  , Types of clothing , Importance of clothing Shelter  , Types of shelter , Importance of shelter Healthcare \r\n, Effects of pollution , Environme ntal impact Personal hygiene  \r\nEducation \r\nTools for communication \r\nTransportation', 'Inclusive and Differentiated Learning Individual seat works or work in mixed groups according to gender, abilities, learning styles, etc. \r\n Group Work: Discuss how the basic needs are important    Individual work: Demonstrate how each basic need impact your life  Group Work:  Discuss the importance of food to man Individual work: Discuss where you get your food from Individual work: List the types of clothing and their usefulness   \r\n Group Work:  Discuss what to wear under different weather conditions Individual work: Draw different kinds of shelters on posters or sheets and explain where they are used Peer work: Discuss some types of shelter found in your neighborhood Group Work:  Discuss some means of healthcare  \r\n Individual work Identify the health hazard of pollution  \r\n Mixed Group work:  Discuss good and bad ways to use cell phone gadgets \r\n Drama: Dramatize proper ways to use communication tools \r\n Individual work  Identify the three main ways of transportation  Group work: Construct a model boat with reusable materials', 'Poster  list of some basic needs Markers Pictures of various food items Food pyramid Nutrition chart Markers  Pens Poster sheets Color pencils Seeds, cutting, cassava potatoes, eddoes, oranges \r\nDiagrams and pictures of different types of clothing  in different climate conditions and weather \r\nPictures of different types of shelters www.healthychildren.org \r\nPictures of clinics, hospitals Picture of polluted places Toothbrush \r\nBrushing stick Soap and towel Non-degradable , Plastic , Glass \r\n Picture of children going to school \r\n Poster showing classroom activities \r\n Pictures showing prominent educated citizens \r\n Cell phones,  computers, radios, television Visual aids , Model cars , Model boats , Model airplane, etc Paper, glue, rulers, pencils, modeling clay, scissors', 'EXPECTED COMPETENCI ES  \r\n Effective communic ation skills  ,analytical and research skills , Research and problem solving skills   ASSESSMENT STRATEGIES\r\n Will be used to test for competencies, select relevant options. \r\na. Quizzes b. Class works c. Assignments, attendance d. Class participation e. Individual presentations f. Lab works Test'),
(7, 'Social Studies', '', '2', 'Grade One', '4', 'MAN AND HIS ENVIRONMENT', 'Learners will identify  food types typical of Liberia and other West African countries  \r\n Learners are able to tell the kinds of clothes worn in Liberia and other parts of Africa and practice wearing indigenous Liberian clothes regularly \r\n \r\nLearners are able to appreciate houses typical of Liberia  Learners are able to recognize the importance of living together with other people \r\nLearners will appreciate the importance of different family values', 'Upon completion of this topic, learners should be able to: \r\n1. Differentiate food types in Liberia and other West African countries 2. Describe clothes typical to Liberia and other West African countries 3. Distinguish structure types of Liberia from those of other West African countries 4. Appreciate that they are individuals but part of a family  5. Appreciate different family values', 'Food types in Liberia  \r\n \r\nFood types in other West African countries  \r\n Traditional clothes types worn in Liberia  \r\n Traditional clothes types worn  in other parts of West Africa  \r\n House types in Liberia (New Geography of Liberia)  \r\n \r\nHouse types in West Africa \r\n Self-identity \r\n Family relations \r\n Friends and people in other areas \r\n Human Values (individual value, family value and peer value) \r\n \r\nUnity/fellowship', 'Inclusive and Differentiated Learning Individual seat works or work in mixed groups according to gender, abilities, learning styles, etc. \r\n Teacher For The Day: Discuss how to grow food in Liberia \r\n Mixed Group Work: Discuss how to grow food in other West African countries,  and (b) sketch kinds of food that are grown in Liberia & other West African countries  Individual work: Tell the differences in clothes worn in Liberia and other West African countries  \r\n Mixed group work: Sketch and describe some of the indigenous clothes types of Liberia   \r\n Individual work:  Discuss how you can wear other West African clothes to school on African Costume Day \r\n Individual work: Bring pictures of house structures in your neighborhood to class  \r\n Mixed Group Project: Make a paper model of your school building Home Work: Make a paper model of a house structure in your community \r\n Role-play  positive self-esteem   \r\n Individual Work: Draw the parts of your body on a poster sheet.  \r\n Individual Work: Stand before the class holding the poster with your body parts, (b) name the body parts oneby-one and explain their functions; (c) afterward, announce  your own name and say ?I AM SPECIAL!? (e.g., ?I am Jebbeh or Doe, and I am special!�) \r\n Report: Ask your parents or guardians at home about family values, and make a report to the class.', 'A. Primary  Text: B. Secondary Text: C. Other: Resources/Suppleme ntary Readings: \r\nPoster sheets, pencils, pens, markers, etc.  Pictures of people working together on farm  \r\nPoster showing different types of Liberian clothes   \r\n \r\nPoster showing different types of West African clothes \r\n Poster sheets with drawings of house structures \r\n Cutouts of raditional house structures in Liberia and West Africa   \r\n \r\nChart of human body parts \r\n Posters Pens Paper Ruler \r\nLarge chart outlining human values', 'EXPECTED COMPETENCIE S  \r\n1.Effective communicat ion skills   2.Analytical and research skills 3.Research and problem solving skills   ASSESSMENT STRATEGIES: \r\n  will be used to test for competencies, select relevant options. \r\na. Quizzes b. Class works c. Assignment s,'),
(8, 'Social Studies', '', '2', 'Grade One', '4', 'POLITICAL SUB-DIVISIONS, SIMILARITIES AND DIFFERENCES, AND NATIONAL SONGS AND SYMBOLS', 'Learners are able to develop a sense of nationalism and patriotism to Liberia', 'Upon completion of this topic, learners will: \r\n1. identify the political subdivisions of Liberia  2. sketch flags of counties in Liberia  differentiate 3. differentiate the smaller political subdivisions (from the larger ones) of Liberia 4. sing the national anthem and identify national symbols 5. demonstrate obedience to the rule of law', 'Counties County Capitals  County Leadership  , Roles of county leaders  \r\n \r\n, Counties Flags County  Districts  Chiefdoms Clans Town Song The Seal of Liberia Basic Civics\r\nThe National Anthem The Pledge of Allegiance The Lone Star', 'Inclusive and Differentiated Learning \r\n Individual seat works or work in mixed groups according to gender, abilities, learning styles, etc. Group Work: Sketch a large political map  of Liberia and place it on the classroom wall   Individual work: Identify the counties on the political map of Liberia  \r\n \r\nHome Work:  List the superintendents of each county  \r\n \r\nIndividual work: Sketch each county flag, and (b) describe the meaning of symbols on each county flag Mixed Group work: Discuss the meaning of \r\n \r\nIndividual work:  Draw the flag of Liberia \r\n \r\nIndividual work:  Sing national anthem and the Lone Star \r\n Individual work:  Say the Pledge of Allegiance   \r\n Mixed Group Work: Read lines from your Civics book and discuss attitudes that are patriotic and attitudes that are unpatriotic  \r\n Drama:  Dramatize a situation in which you are helping an elderly person who is sick at their home', 'A. Primary  Text: B. Secondary Text: C. Other: Resources/Sup plementary Readings: \r\nPolitical map of Liberia  Cutout of individual counties.  Poster of a Town Chief holding meeting in Palaver Hut  \r\nList of county officials Poster showing pyramid leadership structure of county \r\nFlag of Liberia on classroom wall \r\n \r\nWording of Liberian patriotic songs on poster sheets \r\nCivics rules on large poster on classroom wall \r\n \r\nOnline civics resource', 'Expected COMPETENCIES\r\n? Effective communication skills   ? Analytical and research skills ? Research and problem solving skills   ASSESSMENT STRATEGIES: \r\n Will be used to test for competencies, select relevant options. \r\na. Quizzes b. Class works c. Assignments, attendance d. Class participation Individual test');
