INSERT INTO `exercises` (`id`, `class`, `subject`, `topic`, `question`, `option_1`, `option_2`, `option_3`, `answer`, `point`, `addedOn`) VALUES
(1, 'Grade One', 'General Science', 'Rocks and Volcanoes', 'What causes a volcano?', 'Volcanoes are formed when a mountain becomes gigantic and arcade', 'Poor human waste practices over many long years', 'The almighty god', 'Volcanoes are formed by eruptions of lava and ash when magma rises through cracks or weak-spots in the Earths crust', 1, ''),
(2, 'Grade One', 'General Science', 'Cell', 'what is a cell membrane?', 'The part of the cell that helps it to think just like the human brain', 'The memory portion of a cells brain - the membrain.', 'the innermost part of the cell', 'the semipermeable membrane surrounding the cytoplasm of a cell.', 1, ''),
(3, 'Grade One', 'General Science', 'Cells', 'What is a cell?', 'a small box in a Microsoft Excel program', 'A place where prisoners are kept', 'a cell is simply a short way of saying cellphone ', 'the basic structural, functional, and biological unit of all known organisms', 1, ''),
(4, 'Grade One', 'General Science', 'Rocks and Volcanoes ', 'Which of the following best describes lava?', 'sand', 'soupy liquid', 'hot blazing fire', 'Lava is molten rock generated by geothermal energy and expelled through fractures in planetary crust or in an eruption, usually at temperatures from 700 to 1,200', 1, '');
